import React from 'react'

const Header = () => {
  return (
    <div className='flex h-20 w-full shadow-md'>
        <div className='flex items-center justify-center w-full bg-white text-blue-700:hover'>
            <h1 className='text-2xl'>Voice Activity Detection</h1>
        </div>
    </div>
  )
}

export default Header
